import React, { useState } from 'react'
import img1 from "../../img/Alogo.svg";
import "../dashbord/bor";

export default function Bord() {

  const [shoLogo , setShowLogo] = useState(false)
  return (
    <>
    <div className="navbar">
      <nav className="nav">
        <div className="logo">
          <img src={img1} alt="/" />
            <h4>Dashbord</h4>
        </div>

        <div className="box" onClick={() => setShowLogo(true)}>
          Ekasha Admin
        </div>
      </nav>
      {shoLogo}
    </div>
    </>
  )
}
